                    STB_ST_TI113: "Data on usage behaviour are not collected",
                    STB_ST_TI114: "Data on usage behaviour is collected",
                    INFOTITLE_USAGEDATA: "What data is collected?",
                    INFOTEXT_USAGEDATA: "<p>Collection of usage data for product development</p></br><p>Furthermore we collect usage data.Usage data include information on the functions of EntertainTV you use, e.g.consumed content (Video Store, Live TV, Recordings) as well as on, off, and switch activity. This usage data is pseudonymised after collection and before analysis and aggregated to statistics.The statistical analysis of the usage data is performed anonymously, so that no conclusions can be drawn concerning individual customers / users /Media Receivers, EntertainTV mobile applications on Smartphone, Tablet or PC.</p><p>All collected data is deleted after max. 3 months. Usage data analyses (e.g.the total usage time for Sat.1 on Friday) are anonymous and do not include any information on individual customers / users.This implementation complies with all statutory requirements of German data protection legislation.</p><p>The collection of usage data enables us to make adjustments and an improved structure of the channel selection and content of the video stores online or in the TV media centers based upon customer wishes. The user friendliness of the EntertainTV main menu can be improved continuously and attractive functions such as video stores, TV media centers and time-delayed TV viewing / TimeShift can be developed further.</p></br><p>The following usage data is currently collected:</p><p>-Number of connections of the Media Receiver to the EntertainTV platform</p><p>- Number of active Media Receivers</p><p>- Usage time</p><p>-Number of channel tunes per channel</p><p>- Number of active users</p></br><p>Notice: Please be aware that after activation or deactivation of the usage data collection all EntertainTV and EntertainTV mobile devices are synchronised.This can take several seconds until all devices have received the information. Until then, please do not alter the setting again.</p>",
