                    STB_CM_TI013_B: "There are no hidden channels.",
                    STB_CM_TI013_C: "You have not added any channels to your favourites.",
                    STB_CM_TI024: "Please change to the editing mode by pressing the OK button. Move channels with the arrow buttons or by entering the channel location directly. With \"hide\" you can move seldom used channels to the end of the list.",
                    STB_ST_TI012: "HD/SD Mode",
                    STB_ST_TI049: "Some TV channels are transmitted in standard quality (SD) and high quality (HD). This means that the same channel is listed numerous times in your channel list. The HD/SD mode merges these channels together, so that only one channel is listed with the desired quality (so long as the desired quality is available).",
                    STB_ST_TI050: "Always best possible quality",
                    STB_ST_TI051: "Always standard quality",
                    STB_ST_TI052: "What is the \"Auto-Quality\" function?",
                    STB_ST_TI053: "Always best possible quality",
                    STB_ST_TI054: "With this setting your Media Receiver tunes to the HD channel (if possible) for broadcasters that transmit in both standard quality (SD) and high definition (HD). This can lead to more data being transfered and in some cases less programs being recorded or watched at the same time. By pressing the OPT button on your remote control while watching a program, you can always change to standard quality.",
                    STB_ST_TI055: "Always standard quality",
                    STB_ST_TI056: "With this setting your Media Receiver automatically tunes to standard quality for broadcasters that transmit in both standard quality (SD) and high definition (HD). As the data consumption is lower for SD than for HD, in some cases more programs may be watched or recorded at the same time. By pressing the OPT button on your remote control while watching a program, you can always change to HD quality.",
                    INFOTEXT_HDSD: "<h3>Always best possible quality</h3><p>With this setting your Media Receiver tunes to the HD channel (if possible) for broadcasters that transmit in both standard quality (SD) and high definition (HD). This can lead to more data being transfered and in some cases less programs being recorded or watched at the same time. By pressing the OPT button on your remote control while watching a program, you can always change to standard quality.</p></br><h3>Always standard quality</h3><p>With this setting your Media Receiver automatically tunes to standard quality for broadcasters that transmit in both standard quality (SD) and high definition (HD). As the data consumption is lower for SD than for HD, in some cases more programs may be watched or recorded at the same time. By pressing the OPT button on your remote control while watching a program, you can always change to HD quality.</p>",
                    STB_ST_TI013: "HDCP copy protection",
                    STB_ST_TI057: "Here you can specify that the HDCP copy protection should not only be implemented for specially identified channels but also for all other channels as well.",
                    STB_ST_TI058: "Implement for all channels ",
                    STB_ST_TI058_A: "(recommended)",
                    STB_ST_TI059: "Implement only for channels with HDCP copy protection",
                    STB_ST_TI060: "(this can delay the tuning between channels)",
                    STB_ST_TI150: "What is HDCP copy protection?",
                    STB_ST_TI151: "HDCP copy protection is a digital encryption system for the transmission of HD content. We recommend that you leave the copy protection always activated, as it otherwise may result in delays during tuning between channels.",
                    STB_ST_TI014: "Energy options",
                    STB_ST_TI061: "Here you can select in which mode your Media Receiver should be set when you want to switch it off.",
                    STB_ST_TI062: "Define current selection as standard.",
                    STB_ST_TI063: "Energy Saving Mode",
                    STB_ST_TI064: "Stand-by Mode",
                    STB_ST_TI064_A: "Energy Saving Mode Plus",
                    STB_ST_TI065: "In the Energy Saving Mode specific functions can only be used in a limited way.",
                    STB_ST_TI065_A: "In the Stand-by Mode you can use all of EntertainTV's functions without limitation.",
                    STB_ST_TI065_B: "In the Energy Saving Mode Plus recordings planned via a slave receiver or EntertainTV mobile will still be started.",
                    STB_ST_TI067: "What is the Energy Saving Mode?",
                    STB_POWER_MODE_TEXT_G4: "<h3>What is the Energy Saving Mode?<h3><p>In the  Energy Saving Mode cannot use all of EntertainTV's recording functions, as the Media Receiver is not connected to the internet.</br>The following functions are not available:</br>  - - During this period recordings planned via EntertainTV mobile will not be executed.</br>  - Second - Slave receivers cannot access recordings stored on this receiver.</p></br><h3>What is the Stand-by Mode?</h3><p>In the Stand-by Mode you can use all of EntertainTV's recording functions without limitation.</p></br><h3>What is the Energy Saving Mode Plus?</h3><p>In the Energy Saving Mode Plus recordings planned via a slave receiver or EntertainTV mobile will still be started.</p>",
                    STB_POWER_MODE_TEXT_G5: "<h3>What is the Energy Saving Mode?<h3><p>In the  Energy Saving Mode cannot use all of EntertainTV's recording functions, as the Media Receiver is not connected to the internet.</br>The following functions are not available:</br>  - - During this period recordings planned via EntertainTV mobile will not be executed.</br>  - Second - Slave receivers cannot access recordings stored on this receiver.</p></br><h3>What is the Stand-by Mode?</h3><p>In the Stand-by Mode you can use all of EntertainTV's recording functions without limitation.</p></br><h3>What is the Energy Saving Mode Plus?</h3><p>In the Energy Saving Mode Plus recordings planned via a slave receiver or EntertainTV mobile will still be started.</p>",
                    STB_PM_T1001: "Turn off the Media Receiver",
                    STB_PM_T1002_1: "Hier w\u00E4hlen Sie aus, in welchen Modus Sie Ihren Media Receiver beim Ausschalten versetzen m\u00F6chten. Der Media Receiver wird in",
                    STB_PM_T1002_2: "automatisch ausgeschaltet.",
