                    STB_PM_T1010: "With the Stand-by mode you can use all functions of EntertainTV without constraint. Further information via the i button.",
                    STB_PM_T1011: "In the Energy saving mode the use of specific functions is limited. Further information via the i button.",
                    STB_PM_T1012: "As with Energy saving mode \u2013 however a slave receiver is able to wake up the main receiver remotely. Further information via the i button.",
