                    INFOTITLE_HDD: "Storage space on the harddrive",
                    INFOTEXT_HDD: "<p>This overview shows you the free and used storage space on the harddrive.</p></br><p>If you require more storage space, you can delete no longer required content under \"My Content\" from the harddrive.</p></br><p>You can also delete all content from the harddrive. For this please select \"Delete harddrive\".</p></br><p>Please note that a certain portion of the storage space on the harddrive is reserved for functions and system resources and this cannot be deleted. With a harddrive usage of more than 85% then Timeshift is no longer possible for slave receivers.</p>",
