                    HILFE_TITLE: "Hilfe",
                    HILFE_WELCOME: "<div class='A-FO-B1-1'>Wann w\u00E4hle ich die Standard-Einstellungen?</div><p class='A-FO-B1-2'>Die Standard-Einstellungen k\u00F6nnen Sie ausw\u00E4hlen, wenn an Ihrem Media Receiver 1 Satellitenkabel, das den Unicable Standard (CENELEC EN 50494) nicht unterst\u00FCtzt, angeschlossen is und der Satellit Astra 19,2\u00B0 Ost verbunden werden soll. <br> Sofern Ihre Ger\u00E4teinstallation andere Einstellungen vorsieht oder den Unicable Standard (CENELEC EN 50494) unterst\u00FCtzt, k\u00F6nnen Sie den schnellen Weg nicht nutzen. W\u00E4hlen Sie in diesem Fall \u201EDie Standard-Einstellungen passen nicht\u201C aus.</div><div class='A-FO-B1-1'>Was ist der Unicable Standard (CENELEC EN 50494)?</div><p class='A-FO-B1-2'>Der Unicable Standard (CENELEC EN 50494) ist eine Satellitentechnologie, deren Verbreitung in den letzten Jahren zugenommen hat. Falls Ihre Satellitenanlage den Einkabelstandard unterst\u00FCtzt, w\u00E4hlen Sie den Punkt \u201EDie Standard-Einstellungen passen nicht\u201C aus.</p>",
                    HILFE_CURRENTSETTINGS: "<div class='A-FO-B1-1'>Aktuelle Satelliten-Einstellungen \u00E4ndern</div><p class='A-FO-B1-2'>Sie k\u00F6nnen die gespeicherten Satelliten-Einstellungen jederzeit \u00E4ndern. Aufnahmen, die zu dem Zeitpunkt laufen, m\u00FCssen unterbrochen werden.</p>",
                    HILFE_NUMBEROFCABLES: "<div class='A-FO-B1-1'>Wie viele Satellitenkabel sind verbunden?</div><p class='A-FO-B1-2'>Sie k\u00F6nnen bis zu 2 Satellitenkabel an Ihrem Media Receiver anschlie\u00DFen.<br>Wenn Sie 1 Satellitenkabel verwenden, dann schlie\u00DFen Sie dieses Kabel auf der R\u00FCckseite Ihres Media Receivers am Satellitensignal-Anschluss LNB 1 an.</p><div class='A-FO-B1-1'>Was ist der Unicable Standard (CENELEC EN 50494)?</div><p class='A-FO-B1-2'> Der Unicable Standard (CENELEC EN 50494) ist eine Satellitentechnologie, deren Verbreitung in den letzten Jahren zugenommen hat. Ob Ihre Satellitenanlage den Unicable Standard (CENELEC EN 50494) unterst\u00FCtzt, erfahren Sie in der Bedienungsanleitung Ihrer Satellitenanlage. Alternativ informieren Sie sich bitte bei Ihrem Vermieter oder Ihrer Hausverwaltung.<br>Stellen Sie sicher, dass Ihre Satellitenanlage den Einkabelstandard (CENELEC EN 50494) unterst\u00FCtzt, bevor Sie die Option \u201E1 Satellitenkabel - Unicable Standard (CENELEC EN 50494)\u201C ausw\u00E4hlen.<br>W\u00E4hlen Sie die Optionen \u201E1 Satellitenkabel\u201C oder \u201E2 Satellitenkabel\u201C aus, wenn Ihre Satellitenanlage den Einkabelstandard (CENELEC EN 50494) nicht unterst\u00FCtzt.<br>Sie k\u00F6nnen diese Einstellungen nachtr\u00E4glich im Hauptmen\u00FC unter Einstellungen > Satelliten-Einstellungen > Satelliten-Installation \u00E4ndern.</p>",
                    HILFE_TUNER: "<div class='A-FO-B1-1'>Warum gibt es 2 Tuner?</div><p class='A-FO-B1-2'>Sie k\u00F6nnen 2 Tuner einrichten, um parallel einen Sender anzuschauen und gleichzeitig einen Weiteren aufnehmen zu k\u00F6nnen. Daf\u00FCr m\u00FCssen Sie f\u00FCr Tuner 1 und Tuner 2 eine Frequenz einstellen.</p><div class='A-FO-B1-1'>Wie konfiguriere ich die Tuner?</div><p class='A-FO-B1-2'>Tuner 1 und Tuner 2 k\u00F6nnen nacheinander eingerichtet werden. Geben Sie hierf\u00FCr die Teilnehmer-Frequenz Ihrer Satelliten-Anlage ein. Bitte beachten Sie, dass die Teilnehmer-Frequenz noch nicht von einem anderen Media Receiver in Ihrem Haushalt/Geb\u00E4ude verwendet wird.</p><div class='A-FO-B1-1'>Wo finde ich die Teilnehmer-Frequenz und den zugeh\u00F6rigen Frequenz-Wert?</div><p class='A-FO-B1-2'>Die Teilnehmer-Frequenz und der zugeh\u00F6rige Frequenz-Wert befindet sich entweder auf den Komponenten der Satellitenanlage oder in der dazugeh\u00F6rigen Bedienungsanleitung. Alternativ informieren Sie sich bitte bei Ihrem Vermieter oder Ihrer Hausverwaltung.<br>Sie k\u00F6nnen diese Einstellungen nachtr\u00E4glich im Hauptmen\u00FC unter Einstellungen > Satelliten-Einstellungen > Satelliten-Installation \u00E4ndern.</p>",
                    HILFE_NUMBEROFSATELLITES2: "<div class='A-FO-B1-1'>Wie viele Satelliten kann ich verbinden?</div><p class='A-FO-B1-2'>Unterst\u00FCtzt Ihre Satellitenanlage den Unicable Standard (CENELEC EN 50494), k\u00F6nnen Sie bis zu 2 Satelliten unabh\u00E4ngig voneinander \u00FCber ein einzelnes Satellitenkabel empfangen.<br>Bitte stellen Sie sicher, dass Ihre Satellitenanlage auch 2 Satelliten unabh\u00E4ngig voneinander empfangen kann.<br>Sie k\u00F6nnen diese Einstellungen nachtr\u00E4glich im Hauptmen\u00FC unter Einstellungen > Satelliten-Einstellungen > Satelliten-Installation \u00E4ndern.</p>",
                    HILFE_NUMBEROFSATELLITES4: "<div class='A-FO-B1-1'>Wie viele Satelliten kann ich verbinden?</div><p class='A-FO-B1-2'>Mit der DiSEqC-Funktion Ihrer Satellitenanlage k\u00F6nnen Sie bis zu 4 Satelliten gleichzeitig ansteuern. Bitte beachten Sie, dass Ihre Satellitenanlage diese Funktion unterst\u00FCtzt.<br>Sie k\u00F6nnen diese Einstellungen nachtr\u00E4glich im Hauptmen\u00FC unter Einstellungen > Satelliten-Einstellungen > Satelliten-Installation \u00E4ndern.</p>",
                    HILFE_SATPOSITION: "<div class='A-FO-B1-1'>Was wird mir hier angezeigt?</div><p class='A-FO-B1-2'>In diesem Schritt wird die Signalst\u00E4rke und Signalqualit\u00E4t \u00FCberpr\u00FCft.<br>Wenn Sie keine ausreichende Signalst\u00E4rke oder Signalqualit\u00E4t haben, befolgen Sie bitte die Handlungsempfehlungen oder stellen Sie sicher, dass Ihre Satellitenanlage auf den von Ihnen ausgew\u00E4hlten Satelliten ausgerichtet ist.<br>Sie k\u00F6nnen diese Einstellungen nachtr\u00E4glich im Hauptmen\u00FC unter Einstellungen > Satelliten-Einstellungen > Satelliten-Installation \u00E4ndern.</p>",
